import styled from "styled-components"
import MainTopNavContainer from "./Components/Container/MainTopNavContainer"
import MainLeftNavContainer from "./Components/Container/MainLeftNavContainer"
import MainChannelNavContainer from "./Components/Container/MainChannelNavContainer"

const UnderDiv = styled.div`
    display:flex;

    width: 100%;
    height: 100%;
`

const MainBoxContainer = () => {
    return (
        <>
            <MainTopNavContainer />
            <UnderDiv>
                <MainLeftNavContainer />
                <MainChannelNavContainer />
            </UnderDiv>
        </>
    )
}

export default MainBoxContainer;
